// import logo from './logo.svg';
import './App.css';
import Home from './pages/Home';
// import './Layout/HomeContent';
// import './Layout/Header';
// import { Routes, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={ <Home/> } />
      </Routes>
    <Home/>
    </div>
  );
}

export default App;
